import React, { Component } from 'react';
import './App.css';
import StackGrid from "react-stack-grid";

class App extends Component {
  render() {
    return (
      <StackGrid
        columnWidth={150}
      >
        <div key="key1">Item 1</div>
        <div key="key2">Item 2</div>
        <div key="key3">Item 3</div>
      </StackGrid>
      );
    }
  }

  export default App;
